import React from "react";
import Button from "./Button";

const CartItem = ({ item }) => (
  <>
    <div className="cart-item">
      <div className="theItem">
        <img src={require(`../img/${item.image}`)} alt={item.name} />
        <p>{item.name}</p>
      </div>
      <p>01</p>
      <p>{item.price}</p>
      <Button text="CHECK OUT" classes="" />
    </div>
  </>
);

export default CartItem;
